# -*- coding: utf-8 -*-
import execjs
import base64
import json

"""
企名片 js 加密参数破解
https://www.qimingpian.com/finosda/project/pinvestment
"""


def decrypt(encrypt_data):
    ctx = execjs.compile(open('js/qimingpian.js').read())
    return base64.b64decode(ctx.call('my_decrypt', encrypt_data))


if __name__ == '__main__':
    encrypt_data = ''
    decrypt_data = decrypt(encrypt_data)

    json_data = json.loads(decrypt_data)
    print(json_data)
